import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import { AboutUs, FindUs, Footer, Gallery, Header, Intro, SpecialMenu, Footer2, Spacer } from './container';
import { Navbar } from './components';
import NewPage from './NewPage'; // Yeni sayfan覺z覺 import edin
import './App.css';

const App = () => (
  <Router>
    <div className='bg'>
      <Navbar />
      <Switch>
        <Route path="/" exact>
          <Header />
          <AboutUs />
          <SpecialMenu />
          <Intro />
          <Gallery />
          <FindUs />
          <Footer2/>
          <Spacer/>
          <Footer />
        </Route>
        <Route path="/newpage" exact component={NewPage} /> 
        <Header />
        <Footer />
      </Switch>
    </div>
  </Router>
);

export default App;
